def __getPath(node, path, name):
    if isinstance(node, QuestDNA):
        if node.getQuestId() == name:
            return (True, path)
        else:
            return (
             False, path)
    for ladder in node.getContainers():
        found, path = __getPath(ladder, path, name)
        if found:
            path.insert(0, ladder)
            return (
             found, path)

    return (
     False, path)


