def getFilteredContainerList(ladderName):
    ladder = getContainer(ladderName)
    containerList = ladder.getContainers()
    filteredContainerList = []
    currIndex = 0
    firstQuestId = ladder.getFirstQuestId()
    for i in range(len(containerList)):
        if containerList[i].getName() == firstQuestId:
            currIndex = i
            break

    while currIndex < len(containerList):
        container = containerList[currIndex]
        filteredContainerList.append(container)
        currIndex += 1 + QuestLinkDB.getQuestLink(container.getName())

    return filteredContainerList


def calculateContainerWeight(containerId, itemCount):
    container = getContainer(containerId)
    if isinstance(container, QuestDNA):
        QuestWeightTable[containerId] = (
         1, itemCount)
        return (
         1, itemCount + 1)
    totalWeight = 0
    subCount = itemCount
    containerList = getFilteredContainerList(containerId)
    for container in containerList:
        weight, itemCount = calculateContainerWeight(container.getName(), itemCount)
        totalWeight += weight

    QuestWeightTable[containerId] = (
     totalWeight, subCount)
    return (
     totalWeight, itemCount)


QuestWeightTable = {}
for ladderId in FameQuestLadderDict.keys():
    calculateContainerWeight(ladderId, 0)

def getContainerWeight(containerId):
    weight = QuestWeightTable.get(containerId)
    if weight:
        return weight[0]
    return 0


def getContainerCount(containerId):
    count = QuestWeightTable.get(containerId)
    if count:
        return count[1]
    return 0


def getPercentComplete(containerId, questId):
    completed = getContainerCount(questId) - getContainerCount(containerId)
    total = getContainerWeight(containerId)
    return (
     completed, total)


